import './css/UI.css';

function Dash(){
  var myDate = new Date();
  var day="Monday";
  var hour=2;
  var minute=10;
  var today="05";
  var completed="00";
    return(
      <div className="Dash Card">
      <br></br>

      <div className="card-body">
      {day}, {hour}:{minute}
      <br></br>
      <div className="activity row">
      <div>
      {today}
      Today
      </div>
      <div>
      {completed}
      Completed
      </div>
      </div>
      </div>

      </div>
  );
}
export default Dash;
